import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';

class ZoneStats extends Component{

    constructor(props) {
        super(props);
        this.state = {
            number : 0,
            current : 0,
            startDate : null,
            endDate : null
        };

        this.onNumberFixed = this.onNumberFixed.bind(this);
        this.onCycleFixed = this.onCycleFixed.bind(this);
        this.onStartDateFixed = this.onStartDateFixed.bind(this);
        this.onEndDateFixed = this.onEndDateFixed.bind(this);
    }


    render() {
        let items = [];
        for (let i=1;i<=this.state.number;i++) {
            items.push(<option value={i}>{i}</option>);
        }
        return(
            <div>
                <div className="input-group">
                    <div className="input-group-prepend">
                        <span className='input-group-text'>Current Cycle</span>
                    </div>
                    <input type='number' name="currentCycle" onChange={this.onNumberFixed} id="currentCycle" />
                </div><br />
                <div className="input-group">
                    <div className="input-group-prepend">
                        <span className='input-group-text'>Select cycle</span>
                        <select name="cycleNumber" onChange={this.onCycleFixed} id="cycleNumber">
                            {items}
                        </select>
                    </div>
                </div><br />
                <article className="br2 ba dark-gray b--black-10 mv4 w-100 w-50-m w-25-l mw5 center">
                    <img src="http://placekitten.com/g/600/300" className="db w-100 br2 br--top"
                         alt="Photo of a kitten looking menacing." />
                        <div className="pa2 ph3-ns pb3-ns">
                            <div className="dt w-100 mt1">
                                <div className="dtc">
                                    <h1 className="f5 f4-ns mv0">Cat</h1>
                                </div>
                                <div className="dtc tr">
                                    <h2 className="f5 mv0">$1,000</h2>
                                </div>
                            </div>
                            <p className="f6 lh-copy measure mt2 mid-gray">
                                If it fits, i sits burrow under covers. Destroy couch leave hair everywhere,
                                and touch water with paw then recoil in horror.
                            </p>
                        </div>
                </article>
            </div>
        );
    }

    onNumberFixed(event) {
        this.setState({
            number : event.target.value,
        })
    }

    onCycleFixed(event) {
        this.setState({
            current : event.target.value,
        })
    }

    onStartDateFixed(event) {
        this.setState({
            startDate : event.target.value,
        })
    }
    onEndDateFixed(event) {
        this.setState({
            endDate : event.target.value,
        })
    }



}

export default ZoneStats;
